import React from 'react';
import './PropertiesPanel.css';

const PropertiesPanel = () => {
  return (
    <div className="properties-panel">
      <h3>Properties</h3>
      <p>Select an item to see its properties.</p>
    </div>
  );
};

export default PropertiesPanel;
